import axios from 'axios';
import React, { useState, useEffect } from 'react';


function UserHistory() {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
      axios.get("http://localhost:3001/userHistory")
      .then(response=>{
        console.log(response.data)
        setData(response.data)
      })
      .catch(error=>{
        console.error("Error",error)
      })
  };

  return (
    <div>
      <h1>Data from MongoDB</h1>
      <table>
        <thead>
          <tr>
            <th>Diabetes in Heredity</th>
            <th>Duration of Physical Activity</th>
            <th>Frequency of Fast Food</th>
            <th>Glucose level</th>
            <th>Blood Pressure</th>
            <th>BMI</th>
            <th>Age</th>
            <th>Prediction</th>
          </tr>
        </thead>
        <tbody>
          {data.map((item, index) => (
            <tr key={index}>
              <td>{item.Heredity === 1 ? 'Yes' : 'No'}</td>
              <td>{item.PhysicalActivity} minutes</td>
              <td>{item.FastFood} </td>
              <td>{item.Glucose} mg/dL</td>
              <td>{item.BloodPressure} mmHg</td>
              <td>{item.BMI} kg/m2</td>
              <td>{item.Age} years</td>
              <td>{item.Outcome} %</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default UserHistory;
